configuration.jsScript:
var temperature = parseFloat(msg.temperature);
var humidity = parseFloat(msg.humidity);
var pH = parseFloat(msg.pH);
var soilMoisture = parseFloat(msg.soil_moisture_filtered);

// Thresholds (from Wokwi code)
var MOISTURE_THRESHOLD_LOW = 30.0;
var MOISTURE_THRESHOLD_HIGH = 35.0;
var TEMP_HEAT_STRESS = 35.0;
var HUMIDITY_HEAT_STRESS = 40.0;
var PH_MIN = 6.0;
var PH_MAX = 7.5;

var irrigationAlert = false;
var heatStressAlert = false;
var phAlert = false;

// ALERT 1: IRRIGATION (Low Soil Moisture)
// Moisture < 30% → irrigation needed
if (soilMoisture < MOISTURE_THRESHOLD_LOW) {
    irrigationAlert = true;
}
// Moisture > 35% → clear irrigation alert (hysteresis)
else if (soilMoisture > MOISTURE_THRESHOLD_HIGH) {
    irrigationAlert = false;
}
else {
   
    irrigationAlert = true;
}

// ALERT 2: HEAT STRESS
// Temperature > 35°C AND Humidity < 40% (BOTH conditions required)
if (temperature > TEMP_HEAT_STRESS && humidity < HUMIDITY_HEAT_STRESS) {
    heatStressAlert = true;
} else {
    heatStressAlert = false;
}

// ALERT 3: pH IMBALANCE
// pH < 6.0 OR pH > 7.5
if (pH < PH_MIN || pH > PH_MAX) {
    phAlert = true;
} else {
    phAlert = false;
}

// Count active alerts
var activeAlerts = 0;
if (irrigationAlert) activeAlerts++;
if (heatStressAlert) activeAlerts++;
if (phAlert) activeAlerts++;

var newMsg = {};

// Original sensor values
newMsg.temperature = temperature;
newMsg.humidity = humidity;
newMsg.pH = pH;
newMsg.soil_moisture_filtered = soilMoisture;

// Calculated alert flags (for dashboard)
newMsg.irrigation_alert = irrigationAlert;
newMsg.heat_stress_alert = heatStressAlert;
newMsg.pH_alert = phAlert;



return {msg: newMsg, metadata: metadata, msgType: msgType};
